	  </a>
	  <br />
	  <div>
		<h3><i className="material-icons">person</i> Experience</h3>
		<p>Benjamin is a second-year student at the School of Information pursuing a <span style="font-weight:bold;">Master of Information Management and Systems</span>, following the Data Science track. Before joining Berkeley, he worked as an eCommerce Manager at an airline based in South America. He has a bachelorâ€™s in <span style="font-weight:bold;">Industrial Engineering and Computer Science</span> from the Pontifical Catholic University of Chile.</p>	
	  </div>

  	<script src="lab4.js"></script>
    </>
  );
};

export default Landing;
